import React from "react";
import ReactDOM from "react-dom";
import './index.css';
import Card from "./Cards";
import Sdata from "./Sdata";
ReactDOM.render(
  <>
    <h1 heading_style> List of Marvel Movies</h1>

    <Card
      imgsrc={Sdata[0].imgsrc}
      title={Sdata[0].title}
      mname={Sdata[0].mname}
      link={Sdata[0].link}
    />
    <Card
      imgsrc={Sdata[1].imgsrc}
      title={Sdata[1].title}
      mname={Sdata[1].mname}
      link={Sdata[1].link}
    />
    <Card
      imgsrc={Sdata[2].imgsrc}
      title={Sdata[2].title}
      mname={Sdata[2].mname}
      link={Sdata[2].link}
    />
  </>,
  document.getElementById("root")
);
